webpackJsonp([48880857124783],{7406:function(a,t){a.exports={data:{post:{html:'<p>I can\'t vote in the Bundestag election next month, and judging from the <a href="http://www.wahlomat.de/" title="Wahl-O-Mat">Wahl-O-Mat</a> I think most Germans are happy with that.</p>\n<p><a href="http://www.wahlomat.de/" title="Wahl-O-Mat: Green 64%, FDP 63%"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2005/08/wahlomat2005.png" border="1" height="314" width="474" alt="wahlomat2005.png" /></a></p>\n<p>I\'ve said before I wish I could vote for a <a href="http://www.papascott.de/archives/2004/03/15/tobias-is-looking-for-a-german-greenish-kind-of-liberal-new-labour-party/">German greenish kind of liberal New Labour party</a>, and this just proves it. <a href="http://www.couchblog.de/webpropaganda/article/960/quod-erat-demonstrandum" title="Webpropaganda: Quod erat demonstrandum">(via Webpropaganda, among others)</a></p>',fields:{title:"Wahl-O-Mat",date:"26 Aug 2005",url:"https://papascott.de/2005-08-26-wahl-o-mat/"}}},pathContext:{slug:"/2005-08-26-wahl-o-mat/",prev:{fields:{title:"PawSense",date:"24 Aug 2005",slug:"/2005-08-24-pawsense/"}},next:{fields:{title:"Mac in Mac",date:"27 Aug 2005",slug:"/2005-08-27-mac-in-mac/"}}}}}});
